import React from "react";

const Skills = () => {
  return (
    <div className="container  mx-auto w-full h-full">
      <p className="text-[#FF004F] mb-5">Features</p>
      <h1 className="education text-5xl mb-7">Design Skills</h1>

      {/* <!-- PhotoShop Skill --> */}
      <div className="mb-8">
        <div className="flex justify-between py-1">
          <span className="text-base text-gray-lite font-semibold dark:text-[#A6A6A6]">
            PhotoShop
          </span>
          <span className="text-base font-semibold text-gray-lite pr-5 dark:text-[#A6A6A6]">
            80%
          </span>
        </div>
        <svg
          className="rc-progress-line"
          viewBox="0 0 100 1"
          preserveAspectRatio="none"
        >
          <path
            className="rc-progress-line-trail"
            d="M 0.5,0.5 L 99.5,0.5"
            strokeLinecap="round"
            stroke="#D9D9D9"
            strokeWidth="1"
            fillOpacity="0"
          ></path>
          <path
            className="rc-progress-line-path"
            d="M 0.5,0.5 L 99.5,0.5"
            strokeLinecap="round"
            stroke="#FF6464"
            strokeWidth="1"
            fillOpacity="0"
            style={{
              strokeDasharray: "79.2px, 100px",
              strokeDashoffset: "0px",
              transition:
                "stroke-dashoffset 0.3s ease 0s, stroke-dasharray 0.3s ease 0s, stroke 0.3s linear 0s, 0.06s",
            }}
          ></path>
        </svg>
      </div>

      {/* <!-- Figma Skill --> */}

      <div className="mb-8">
        <div className="flex justify-between py-1">
          <span className="text-base text-gray-lite font-semibold dark:text-[#A6A6A6]">
            Figma
          </span>
          <span className="text-base font-semibold text-gray-lite pr-5 dark:text-[#A6A6A6]">
            100%
          </span>
        </div>
        <svg
          className="rc-progress-line"
          viewBox="0 0 100 1"
          preserveAspectRatio="none"
        >
          <path
            className="rc-progress-line-trail"
            d="M 0.5,0.5 L 99.5,0.5"
            strokeLinecap="round"
            stroke="#D9D9D9"
            strokeWidth="1"
            fillOpacity="0"
          ></path>
          <path
            className="rc-progress-line-path"
            d="M 0.5,0.5 L 99.5,0.5"
            strokeLinecap="round"
            stroke="#FF6464"
            strokeWidth="1"
            fillOpacity="0"
            style={{
              strokeDasharray: "100px, 100px",
              strokeDashoffset: "0px",
              transition:
                "stroke-dashoffset 0.3s ease 0s, stroke-dasharray 0.3s ease 0s, stroke 0.3s linear 0s, 0.06s",
            }}
          ></path>
        </svg>
      </div>

      {/* ADOBE ILLUSTRATOR */}

      <div className="mb-8">
        <div className="flex justify-between py-1">
          <span className="text-base text-gray-lite font-semibold dark:text-[#A6A6A6]">
            ADOBE ILLUSTRATOR
          </span>
          <span className="text-base font-semibold text-gray-lite pr-5 dark:text-[#A6A6A6]">
            100%
          </span>
        </div>
        <svg
          className="rc-progress-line"
          viewBox="0 0 100 1"
          preserveAspectRatio="none"
        >
          <path
            className="rc-progress-line-trail"
            d="M 0.5,0.5 L 99.5,0.5"
            strokeLinecap="round"
            stroke="#D9D9D9"
            strokeWidth="1"
            fillOpacity="0"
          ></path>
          <path
            className="rc-progress-line-path"
            d="M 0.5,0.5 L 99.5,0.5"
            strokeLinecap="round"
            stroke="#FF6464"
            strokeWidth="1"
            fillOpacity="0"
            style={{
              strokeDasharray: "100px, 100px",
              strokeDashoffset: "0px",
              transition:
                "stroke-dashoffset 0.3s ease 0s, stroke-dasharray 0.3s ease 0s, stroke 0.3s linear 0s, 0.06s",
            }}
          ></path>
        </svg>
      </div>

      {/* XD */}

      <div className="mb-8">
        <div className="flex justify-between py-1">
          <span className="text-base text-gray-lite font-semibold dark:text-[#A6A6A6]">
            ADOBE XD
          </span>
          <span className="text-base font-semibold text-gray-lite pr-5 dark:text-[#A6A6A6]">
            60%
          </span>
        </div>
        <svg
          className="rc-progress-line"
          viewBox="0 0 100 1"
          preserveAspectRatio="none"
        >
          <path
            className="rc-progress-line-trail"
            d="M 0.5,0.5 L 99.5,0.5"
            strokeLinecap="round"
            stroke="#D9D9D9"
            strokeWidth="1"
            fillOpacity="0"
          ></path>
          <path
            className="rc-progress-line-path"
            d="M 0.5,0.5 L 99.5,0.5"
            strokeLinecap="round"
            stroke="#FF6464"
            strokeWidth="1"
            fillOpacity="0"
            style={{
              strokeDasharray: "60px, 100px",
              strokeDashoffset: "0px",
              transition:
                "stroke-dashoffset 0.3s ease 0s, stroke-dasharray 0.3s ease 0s, stroke 0.3s linear 0s, 0.06s",
            }}
          ></path>
        </svg>
      </div>

      {/* Design */}

      <div className="mb-8">
        <div className="flex justify-between py-1">
          <span className="text-base text-gray-lite font-semibold dark:text-[#A6A6A6]">
            Design
          </span>
          <span className="text-base font-semibold text-gray-lite pr-5 dark:text-[#A6A6A6]">
            80%
          </span>
        </div>
        <svg
          className="rc-progress-line"
          viewBox="0 0 100 1"
          preserveAspectRatio="none"
        >
          <path
            className="rc-progress-line-trail"
            d="M 0.5,0.5 L 99.5,0.5"
            strokeLinecap="round"
            stroke="#D9D9D9"
            strokeWidth="1"
            fillOpacity="0"
          ></path>
          <path
            className="rc-progress-line-path"
            d="M 0.5,0.5 L 99.5,0.5"
            strokeLinecap="round"
            stroke="#FF6464"
            strokeWidth="1"
            fillOpacity="0"
            style={{
              strokeDasharray: "80px, 100px",
              strokeDashoffset: "0px",
              transition:
                "stroke-dashoffset 0.3s ease 0s, stroke-dasharray 0.3s ease 0s, stroke 0.3s linear 0s, 0.06s",
            }}
          ></path>
        </svg>
      </div>
    </div>

    // <div className="h-screen flex justify-center items-center">
    //   <div className="max-w-xl mx-auto w-full">
    //     <h4 className="text-3xl md:text-5xl dark:text-white font-bold mb-6">
    //       Skills
    //     </h4>

    //     <div className="mb-7">
    //       <div className="flex justify-between py-1">
    //         <span className="text-base text-gray-lite font-semibold dark:text-[#A6A6A6]">
    //           Web Design
    //         </span>
    //         <span className="text-base font-semibold text-gray-lite pr-5 dark:text-[#A6A6A6]">
    //           80%
    //         </span>
    //       </div>
    //       <svg
    //         className="rc-progress-line"
    //         viewBox="0 0 100 1"
    //         preserveAspectRatio="none"
    //       >
    //         <path
    //           className="rc-progress-line-trail"
    //           d="M 0.5,0.5 L 99.5,0.5"
    //           strokeLinecap="round"
    //           stroke="#D9D9D9"
    //           strokeWidth="1"
    //           fillOpacity="0"
    //         ></path>
    //         <path
    //           className="rc-progress-line-path"
    //           d="M 0.5,0.5 L 99.5,0.5"
    //           strokeLinecap="round"
    //           stroke="#FF6464"
    //           strokeWidth="1"
    //           fillOpacity="0"
    //           style={{
    //             strokeDasharray: "79.2px, 100px",
    //             strokeDashoffset: "0px",
    //             transition:
    //               "stroke-dashoffset 0.3s ease 0s, stroke-dasharray 0.3s ease 0s, stroke 0.3s linear 0s, 0.06s",
    //           }}
    //         ></path>
    //       </svg>
    //     </div>

    //     {/* Other skill sections */}
    //   </div>
    // </div>
  );
};

export default Skills;
